import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import Page from './components/Page';
import Input from './components/Input';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <Page />
    <Input />
  </React.StrictMode>
);
